/* eslint-disable prettier/prettier */
/* eslint-disable no-unused-vars */
/* eslint-disable react/prop-types */
import React, { useEffect, useState } from 'react';
import { Spin, Table, Empty, Radio } from 'antd';
import FeatherIcon from 'feather-icons-react';
import moment from 'moment';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { UserTableStyleWrapper } from '../pages/style';
import { TableWrapper } from '../styled';
import Heading from '../../components/heading/heading';
import { Button } from '../../components/buttons/buttons';
import { Cards } from '../../components/cards/frame/cards-frame';

import { deleteNews, getNews } from '../../redux/news/actionCreator';

const NewsTable = () => {
    const { newsData } = useSelector(state => state.News);
    const checkDataLength = newsData.map((element) => [...element.news]).flat().length === 0;

    const dispatch = useDispatch();

    const usersTableData = [];


    // حوار تعبان 
    // eslint-disable-next-line no-unused-expressions
    newsData?.map(categorys => categorys?.news?.map(category => {
        const { status, title, description, updatedAt, createdAt, _id } = category;
        return usersTableData.push({
            key: _id,
            title: (<div className="user-info">
                <Heading className="user-name" as="h6">
                    {title.length > 12 ? `${title.slice(0, 12)}...` : "title"}
                </Heading>
            </div>
            ),
            createdAt: moment(createdAt).format('DD/MM/YYYY HH:mm'),
            updatedAt: moment(updatedAt).format('DD/MM/YYYY HH:mm'),
            status,
            description,
            category: categorys.category,
            action: (
                <div className="table-actions">
                    <>
                        <Link
                            className="btn-icon"
                            type="info"
                            shape="circle"
                            to={{
                                pathname: '/admin/editNews/${_id}',
                                state: {id: 1, name: 'sabaoon', shirt: 'green'}
                              }}
                        >
                            <FeatherIcon icon="edit" size={16} style={{ color: '#ADB4D2' }} />
                        </Link>
                        <Button
                            className="btn-icon"
                            type="danger"
                            onClick={() => {
                                dispatch(deleteNews(_id, categorys.category));
                            }}
                            to="#"
                            shape="circle"
                        >
                            <FeatherIcon icon="trash-2" size={16} />
                        </Button>
                    </>
                </div>
            ),

        })
    }))

    const adsTableColumns = [
        {
            title: 'Title',
            dataIndex: 'title',
            key: 'title',
        },
        {
            title: 'Created At',
            dataIndex: 'createdAt',
            key: 'createdAt',
        },
        {
            title: "Updated At",
            dataIndex: 'updatedAt',
            key: 'updatedAt',
        },
        {
            title: "Status",
            dataIndex: 'status',
            key: 'status',
        },
        {
            title: "Category",
            dataIndex: 'category',
            key: 'category',
        },
        {
            title: "Description",
            dataIndex: 'description',
            key: 'description',
        },
        {
            title: 'Actions',
            dataIndex: 'action',
            key: 'action',
            width: '90px',
        },

    ];

    return (
        <Cards headless>
            <UserTableStyleWrapper>
                <div className="product-list-action d-flex justify-content-between align-items-center mb-20">
                    <div className="product-list-action__tab">
                        <Radio.Group defaultValue="all">
                            <Radio.Button value="all" onClick={() => dispatch(getNews("All"))}>All</Radio.Button>
                            <Radio.Button value="product" onClick={() => dispatch(getNews("product"))}>Product</Radio.Button>
                            <Radio.Button value="company" onClick={() => dispatch(getNews("company"))}>Company</Radio.Button>
                            <Radio.Button value="announcement" onClick={() => dispatch(getNews("announcement"))}>Announcement</Radio.Button>
                            <Radio.Button value="bug Fix" onClick={() => dispatch(getNews("bug Fix"))}>Bug Fix</Radio.Button>

                        </Radio.Group>
                    </div>
                </div>

                {checkDataLength ? <Cards Cards caption="The simplest use of Empty">
                    <Empty />
                </Cards>
                    :

                    <TableWrapper className="table-responsive">
                        <Table
                            dataSource={usersTableData}
                            columns={adsTableColumns}
                            pagination={false}
                        />
                    </TableWrapper>}
            </UserTableStyleWrapper >
        </Cards >
    );
};

export default NewsTable;
